def minPath(grid, k):
    from heapq import heappush, heappop
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], i, j, k-1, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        cost, x, y, steps, path = heappop(pq)
        if steps == 0:
            return path
        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (cost + grid[nx][ny], nx, ny, steps-1, new_path))

def tri(n):
    def helper(m, memo):
        if m in memo:
            return memo[m]
        if m == 1:
            return 3
        if m % 2 == 0:
            result = 1 + m // 2
        else:
            result = helper(m - 1, memo) + helper(m - 2, memo) + helper(m + 1, memo)
        memo[m] = result
        return result

    memo = {}
    result = []
    for i in range(1, n + 2):
        if i not in memo:
            helper(i, memo)
        result.append(memo[i])
    return result

def digits(n):
